    noted as adjustments for in kinds was made to correct for all in kinds from Freedom
    Works listed on line 11a that were made for expenses related to independent expenditures
    and not operating expenditures.  FECfile automatically creates an expense on line
    21b for every in kind entered, but several of these were actually for expenses
    already reflected on line 24.  Vendor credits for IE's are listed as negative
    IEs to correct totals for elections and candidates.  These refunds are also listed
    as memo entries on line 17 as they are not offsets to operating expenses.\n"
